CREATED BY: BEN MASON 
CREATED ON: 06/06/2025 
DESCRIPTION: GOLDEN QUERY 
TCP-LAT % GOOD SESSIONS
TCP-RTX % GOOD SESSIONS
AVG CLIENT LATENCY
AVG DL THROUGHPUT (DLC)
TCP COUNTS
*/
WITH basedata AS (
    SELECT
        TO_DATE(cal_timestamp_day :: VARCHAR, 'YYYYMMDD') :: DATE AS DATE,  
        ap_mac_address,
        CASE WHEN clientequipment_subscriber_type IN ( 'mod', 'modhsd', 'modaka', 'modcon', 'now', 'nowaka' ) THEN 'xm'
             WHEN clientequipment_subscriber_type IN ( 'hsi' ) THEN 'hsi'
             WHEN clientequipment_subscriber_type IN ( 'wod' ) THEN 'wod'
             WHEN clientequipment_subscriber_type IN ( 'twcsm' ) THEN 'twcsm'
             ELSE 'others'
        END AS clientequipment_subscriber_type,
        COUNT(DISTINCT clientequipment_mac_address) as client_count,        
        -- TCP LATENCY metrics (consolidated with single CASE evaluation)
        SUM(CASE WHEN packet_type_name = 'TCP' THEN upw_upload_tcp_latency_bucket_1_count ELSE 0 END) AS tcp_lat_bucket_1_count,
        SUM(CASE WHEN packet_type_name = 'TCP' THEN upw_upload_tcp_latency_bucket_2_count ELSE 0 END) AS tcp_lat_bucket_2_count,
        SUM(CASE WHEN packet_type_name = 'TCP' THEN upw_upload_tcp_latency_bucket_3_count ELSE 0 END) AS tcp_lat_bucket_3_count,
        SUM(CASE WHEN packet_type_name = 'TCP' THEN upw_total_upload_tcp_latency_bucket_1_usec ELSE 0 END) AS tcp_lat_bucket_1_usec,
        SUM(CASE WHEN packet_type_name = 'TCP' THEN upw_total_upload_tcp_latency_bucket_2_usec ELSE 0 END) AS tcp_lat_bucket_2_usec,
        SUM(CASE WHEN packet_type_name = 'TCP' THEN upw_total_upload_tcp_latency_bucket_3_usec ELSE 0 END) AS tcp_lat_bucket_3_usec,        
        -- TCP RETRANSMISSION (Row count-based methods)
        -- Count of rows with retransmission issues (>4%)
        COUNT(CASE 
            WHEN packet_type_name = 'TCP'
                AND upw_download_retransmitted_packets_count >= 0
                AND upw_download_packets_count > 0
                AND (upw_download_retransmitted_packets_count * 100.0 / upw_download_packets_count) > 4.0
                AND (upw_download_retransmitted_packets_count * 100.0 / upw_download_packets_count) <= 100.0
            THEN 1 
        END) AS row_count_rtx_impacted,
        -- Total count of TCP rows with active downloads
        COUNT(CASE 
            WHEN packet_type_name = 'TCP'
                AND upw_download_retransmitted_packets_count >= 0
                AND upw_download_packets_count > 0
                AND (upw_download_retransmitted_packets_count * 100.0 / upw_download_packets_count) <= 100.0
                AND upw_download_active_millis > 0
            THEN 1 
        END) AS row_count_rtx_total,        
        -- THROUGHPUT VALUES 
        SUM(CASE 
            WHEN upw_download_active_millis > 0 AND application_name = 'DLC'
            THEN upw_download_bytes_count
            ELSE 0 
        END) AS download_bytes_count_dlc,
        SUM(CASE 
            WHEN upw_download_active_millis > 0 AND application_name = 'DLC'
            THEN upw_download_active_millis 
            ELSE 0 
        END) AS download_active_millis_dlc,        
        -- TCP SESSION COUNT
        SUM(CASE WHEN packet_type_name = 'TCP' THEN upw_tcp_count ELSE 0 END) AS tcp_count        
