    CASE WHEN clientequipment_subscriber_type IN ( 'mod', 'modhsd', 'modaka', 'modcon', 'now', 'nowaka' ) THEN 'xm'
         WHEN clientequipment_subscriber_type IN ( 'hsi' ) THEN 'hsi'
         WHEN clientequipment_subscriber_type IN ( 'wod' ) THEN 'wod'
         WHEN clientequipment_subscriber_type IN ( 'twcsm' ) THEN 'twcsm'
         ELSE 'others'
    END
)
SELECT
    DATE as report_date,
    ap_mac_address AS ap_mac,
    clientequipment_subscriber_type AS sub_type,
    client_count,    
    -- TCP Latency percentage (buckets 1+2 considered "good")
    ROUND(
        CASE 
            WHEN tcp_count > 0 
            THEN ((tcp_lat_bucket_1_count + tcp_lat_bucket_2_count) * 100.0 / tcp_count)
            ELSE 0 
        END, 2
    ) AS tcp_lat_pct_good_sessions,    
    -- TCP Retransmission percentage good (Row count-based)
    ROUND(
        CASE 
            WHEN row_count_rtx_total > 0 
            THEN ((row_count_rtx_total - row_count_rtx_impacted) * 100.0 / row_count_rtx_total)
            ELSE 0 
        END, 2
    ) AS tcp_rtx_pct_good_sessions,    
    -- Average client latency in milliseconds
    ROUND(
        CASE 
            WHEN (tcp_lat_bucket_1_count + tcp_lat_bucket_2_count + tcp_lat_bucket_3_count) > 0
            THEN ((tcp_lat_bucket_1_usec + tcp_lat_bucket_2_usec + tcp_lat_bucket_3_usec) / 1000.0 / 
                  (tcp_lat_bucket_1_count + tcp_lat_bucket_2_count + tcp_lat_bucket_3_count))
            ELSE 0 
        END, 2
    ) AS avg_client_latency_ms,    
    -- Average throughput in Mbps for DLC traffic
    ROUND(
        CASE 
            WHEN download_active_millis_dlc > 0 
            THEN ((download_bytes_count_dlc * 8.0 / 1000000.0) / (download_active_millis_dlc / 1000.0))
            ELSE NULL 
        END, 2
    ) AS avg_throughput_mbps_dlc,    
    tcp_count AS total_tcp_sessions,
    row_count_rtx_total AS total_rows    
FROM 
    basedata
ORDER BY 
    total_tcp_sessions DESC